import sys
import os
import unittest
from unittest.mock import MagicMock, patch
import streamlit as st

sys.path.insert(0, '/home/lukas/CS425/Automatic_Taxonomy_Construction_NNs/tests/streamlit')

from LLMchat import chat_page  

class TestChatPage(unittest.TestCase):

    @patch('langchain_experimental.graph_transformers.LLMGraphTransformer')  
    @patch('langchain_neo4j.GraphCypherQAChain')  
    @patch('langchain_ollama.llms.OllamaLLM') 
    @patch('streamlit.chat_input')  
    @patch('streamlit.write')  
    def test_chat_page(self, mock_write, mock_chat_input, MockOllamaLLM, MockGraphCypherQAChain, MockLLMGraphTransformer):
        # Prepare mock objects for Neo4j parts that we will not use
        mock_graph = MagicMock()

        # Mock the behavior of Neo4jGraph and GraphDatabase
        # We won't use actual Neo4j, so we'll mock these objects to simulate database behavior
        mock_graph.get_schema = MagicMock(return_value="mock_schema")
        
        # Mock the behavior of LLMGraphTransformer and GraphCypherQAChain
        mock_llm = MagicMock()
        mock_llm_transformer = MagicMock()
        mock_graph_cypher_chain = MagicMock()

        # Set up the mocks
        MockOllamaLLM.return_value = mock_llm  # Mock the OllamaLLM object
        MockLLMGraphTransformer.return_value = mock_llm_transformer
        MockGraphCypherQAChain.from_llm.return_value = mock_graph_cypher_chain

        # Simulate user input in Streamlit
        mock_chat_input.return_value = "What is GAN?"

        # Simulate the response from the model
        mock_graph_cypher_chain.invoke.return_value = {"result": "GAN stands for Generative Adversarial Networks."}

        # Call the chat_page function
        chat_page()

        # Verify the Streamlit method calls
        mock_chat_input.assert_called_once_with("Enter your prompt:")
        mock_write.assert_called_with("Enter a prompt, and the model will generate a response.") 

        # Ensure that LLM was initialized twice, once with model and once with model + temperature
        MockOllamaLLM.assert_any_call(model="llama3.1:8b-instruct-fp16")
        MockOllamaLLM.assert_any_call(model="llama3.1:8b-instruct-fp16", temperature=0.0)

        # Check that the GraphCypherQAChain was invoked with the correct schema and query
        print(f"Invoke called with: {mock_graph_cypher_chain.invoke.call_args_list}")  
